import React from "react";
import NavBar from "../reuse/NavBar";

function Product() {
  return (
    <div className="home-page">
      <NavBar />
      <div className="main-img">
        <div className="header-img">
          <img
            src="https://www.louisvuitton.com/images/is/image/lv/1/PP_VP_L/louis-vuitton--BC_WOMEN_EDITORIALISATION_045_LVCOM_2048x1152_DI3.jpg?wid=2400"
            alt=""
          />
        </div>
      </div>
    </div>
  );
}

export default Product;
